import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navbar.css';

const menuItems = [
  { path: '/', label: 'ðŸ’¦ MAVJHome ðŸ’¦' },
  { path: '/TheJourney', label: 'ðŸŒ´ TheJourney ðŸŒ´' },
  { path: '/VibrationalIntelligence', label: 'âš›ï¸ VibrationalIntelligence âš›ï¸' },
  { path: '/AlignWithUs', label: 'ðŸŽ‰ AlignWithUs ðŸŽ‰' },
  { path: '/Search', label: 'ðŸ”Ž MAVJSearch ðŸ”Ž' },
  { path: '/LiveBroadcast', label: 'ðŸ“º LiveBroadcast ðŸ“º' },
  { path: '/MAVJStore', label: 'ðŸ’¦ MAVJStore ðŸ’¦' },
  { path: '/PodcastVlog', label: 'ðŸ”¥ Podcast/Vlog ðŸ”¥' },
  { path: '/ContactUs', label: 'â˜Žï¸ ContactUs â˜Žï¸' },
];

const Navbar = () => {
  return (
    <nav className="navbar-container">
      <div className="navbar-logo">
        <NavLink to="/">
          <img src="/images/MAVJLogo.jpg" alt="MAVJ Logo" />
        </NavLink>
      </div>

      <div className="navbar-links">
        {menuItems.map((item) => (
          <NavLink
            key={item.path}
            to={item.path}
            className="navbar-link"
            activeclassname="active-link"
          >
            {item.label}
          </NavLink>
        ))}
      </div>
    </nav>
  );
};

export default Navbar;
